import React from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import AppHeader from "../components/layout/AppHeader";
import AppFooter from "../components/layout/AppFooter";

function App() {
  return (
    <BrowserRouter>
      <div className="App container px-0">
        <AppHeader />
        <Switch>
          <Route exact path="/" component={AppFooter} />
          <Route path="/login" component={AppFooter} />
          <Route path="/register" component={AppFooter} />
          <Route path="/dashboard" component={AppFooter} />
          <Route path="/logout" component={AppFooter} />
          <Route component={AppFooter} />
        </Switch>
        <AppFooter />
      </div>
    </BrowserRouter>
  );
}

export default App;
